import React from 'react'
import ReactDOM from 'react-dom'
const Header = (props) => {
    return (
        <div>
            <p> {props.course} </p>
        </div>
    )
}


const Content = (props) => {
    const values = props.parts;
    return (
        values.map((value) => 
        <div>
            <p> {value.name} {value.exercises} </p>
        </div>)
    )
}

const Total = (props) => {
    const values = props.parts;

    return (
        <div>
            <p>yhteensä {(values[0]).exercises + (values[1]).excercises + (values[2]).excercises} tehtävää</p>
        </div>
    )
}
const App = () => {
    const course = 'Half Stack -sovelluskehitys'
    const parts = [
        {
          name: 'Reactin perusteet',
          exercises: 10
        },
        {
          name: 'Tiedonvälitys propseilla',
          exercises: 7
        },
        {
          name: 'Komponenttien tila',
          exercises: 14
        }
      ]

  return (
    <div>
        <Header course = {course} />
        <Content
            parts = {parts}
        />
        <Total
            parts = {parts}
        />
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
